import React from "react";
import { Provider } from "react-redux";
import store from "./store";
import "./App.css";
// components
import Index from "./components/index";
function App() {
  return (
    <Provider store={store}>
      <div className="App">hello redux</div>
      <Index />
    </Provider>
  );
}

export default App;
